import ReactPlayer from 'react-player';

const Content = () => {
    return (
        <div className="relative w-full h-0" style={{paddingTop: '%'}}>
      <ReactPlayer
        url="https://www.youtube.com/watch?v=dQw4w9WgXcQ"
        className="absolute top-0 left-0 w-full h-full"
        width="50%"
        height="50%"
        playing={true}
      />
    </div>
    );
};

export default Content;
